const Presta = () => {
    return (
      <div className="Presta">
        <h2>Ce que je <span>vous</span> propose,</h2>

        <div className="prestabox">
            <div className="boxpresta"> 
                <h3>Soin du corps</h3>
                <img src="https://i.goopics.net/i4rri8.png" className="imgpresta"></img>
            </div>
            <div className="boxpresta">
                <h3>Soin du visage</h3>
                <img src="https://i.goopics.net/wu1huq.png" className="imgpresta"></img>
            </div>
            <div className="">
                <h3>Massages</h3>
                <img src="https://i.goopics.net/w7vxhm.png" className="imgpresta"></img>
            </div>
        </div>
      </div>
    );
  };
  
  export default Presta;
